function Color( {colors} ) {

    return (
        <div className="color">
            { colors.map(( item, key ) => {
                return <div key={ key } className='box' style={{ backgroundColor: item }}></div>
            })}

            <style jsx>{`
                .color {
                    display: flex;
                    margin: 2em 4em;
                }
                .box {
                    width: 10em;
                    height: 10em;
                    border: 1px solid black;
                }
            `}</style>
        </div>
    )
}

export default Color
